  false,\n\t\"url\": null,\n\t\"notes\": \"We collected spectacled eider (Somateria
  fischeri) eggs and shed breast contour feathers from nests on the Yukon-Kuskokwim
  Delta, Alaska, in 1992 to evaluate baseline contaminant levels. Samples came from
  representative regions on the Delta's outer coast both during and following incubation.
  We present data on inorganic element concentrations from eight feather samples and
  21 eggs. Mercury levels were very low and selenium levels were somewhat elevated,
  although still below levels clearly identified with adverse effects on waterfowl
  reproduction. Eggs and feathers are inappropriate indicators for lead and cadmium
  exposure, and reference guidelines are not available for comparison with the copper
  and zinc levels we detected. Levels of most other trace elements were either below
  detection or below concentrations of concern. Organochlorine pesticide and PCB analyses
  did not meet quality assurance guidelines and are not reported.\",\n\t\"owner_org\":
